import React, { Component } from 'react';

class Navbar1 extends Component{
    render(){
      return(
        <div>
          <nav className='NavbarItems'>
          <h1 className='navbar-logo'>
              React
          </h1>
          <div class="menu-icon">

          </div>

          <ul>  
          <li><a href=''> </a></li>            
          </ul>



        </nav>
        </div>
      )
    }
  }
  
  export default Navbar1;
